import React from "react";
import "./Login.css";
    const Title = () => {
    return (
        <h1 className="font-weight-bold text-center my- 5"><b>Tugas Pertemuan ketiga</b></h1>
        );
    };
    const FormUsername = () => {
    return (
        <div className="form-group mb-3">
        <input
        type="text"
        className="form-control"
        placeholder="Masukkan Username Anda"
        ></input>
    </div>
 );
};
    const FormPassword = () => {
    return (
    <div className="form-group">
        <input
        type="text"
        className="form-control"
        placeholder="Masukkan Password Anda"
        ></input>
    </div>
 );
};
    const RememberMe = () => {
    return (
        <div className="form-check my-4 mr-sm-2">
        <input type="checkbox" className="form-check-input"></input>
        <label className="form-check-label">Remember Me!</label>
        </div>
        );
    };
    const Button = () => {
    return (
        <div className="d-grid gap-2">
        <button type="submit" className="btn btn-success my-1 fontweight-bold">
        Login
        </button>
        <button type="reset" className="btn btn-danger my-1 fontweight-bold">
        Cancel
        </button>
        </div>
    );
    };
    const Login = () => {
    return (
    <body>
    <div className="container">
        <div className="row justify-content-center align-itemscenter vh-100">
            <div className="col-md-4">
                <div className="card">
                    <div className="card-header textcenter">Form Login</div>
                        <div className="card-body">
                        <form>
                        {Title()}
                        {FormUsername()}
                        {FormPassword()}
                        {RememberMe()}
                        {Button()}
                        </form>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    </body>
    );
};
export default Login;
